  declarations: [
    AppComponent,
    EstudiantesListComponent,
    ExperienciasListComponent,
    MaestrosListComponent,
    AddEstudianteComponent,
    AddMaestroComponent,
    AddExperienciaComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule

  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
